    false,nt"url": null,nt"notes": "This data set is one component of a digital
    orthophoto coverage (DOI) over the Southwest Florida Water Management District (SWFWMD)
    North District and Polk District Project Area. This dataset is comprised of color
    DOI cells in a Geotiff format, at a 1-foot pixel resolution, based on the District
    5,000' x 5,000' tile system. This dataset was created from source imagery acquired
    through the Leica ADS40/ADS51 multispectral scanners during the Winter of 2007.
    There are a total of 5,486 cells (tiles) encompassing +/-4,920 square miles in all
    or parts of Alachua, Citrus, Hernando, Lake, Levy, Marion, Pasco, Polk and Sumter
    counties. The companion datasets to this coverage include color infrared DOI at
    the same pixel resolution and geographic extents as the color DOI dataset and a
    dataset comprised of the original imagery mosaic lines with dates of imagery acquisition
    in the ESRI shapefile format.",nt"license_title": null,nt"extras": [{ntt"key":
